import React from "react";

const ContactApp = ({ cnt, index }) => {
  return (
    <div>
      <h3>Contact</h3>
      {cnt.firstName}
      <form>
        <input
          id="firstName"
          name="firstName"
          placeholder="First Name"
          type={"text"}
        ></input>
        <br></br>
        <input
          id="lastName"
          name="lastName"
          placeholder="Last Name"
          type={"text"}
        ></input>
        <br></br>
        <input
          id="phoneNum"
          name="phoneNum"
          placeholder="Phone Number"
          type={"text"}
        ></input>
      </form>
    </div>
  );
};

export default ContactApp;
